    "2013-03-15T22:19:16.922902",nt"name": "bedrock-geologic-map-of-the-liberty-bell-area-fairbanks-a-4-quadrangle-bonnifield-mining-distri",nt"isopen":
    false,nt"url": null,nt"notes": "Report of Investigation 2006-2, "Bedrock
    geologic map of the Liberty Bell area, Fairbanks A-4 Quadrangle, Bonnifield mining
    district, Alaska," is the bedrock geologic map of an approximately 131-square-mile
    area surrounding the Liberty Bell Mine. The geology of the Liberty Bell area, located
    in the northern Alaska Range foothills, comprises Devonian metasedimentary and meta-igneous
    rocks of the Totatlanika Schist and Keevy Peak formations, Cretaceous and Tertiary
    igneous rocks, and overlying unconsolidated Tertiary sedimentary rocks of the Usibelli
    Group and the younger Nenana Gravel.The dataset is comprised of the 32 layers, which
    compose the bedrock geologic map and the inset map. All 32 layers are available
    as shape (*.shp) files. Ten additional Arc Export (*.e00) files of annotation are
    also available for presentational purposes.This report, map, and/or dataset are
    available directly from the State of Alaska, Department of Natural Resources, Division
    of Geological & Geophysical Surveys.",nt"license_title": null,nt"extras":
